Czytaj i oglądaj na żywo TVP Wilno wszędzie i na każdym urządzeniu!

Aplikacja mobilna TVP Wilno pozwala śledzić najważniejsze wydarzenia z Litwy, Polski i całego świata wszędzie, gdzie masz dostęp do sieci. TVP Wilno to newsy i publicystyka, fotogalerie oraz transmisje mszy z wileńskich kościołów.

Pobierz aplikację TVP Wilno i bądź na bieżąco. Miej wszystko, czego potrzebujesz w zasięgu ręki.

Bądź pierwszym, kto dowie się o polskich sprawach na Wileńszczyźnie - kulturze, rozrywce, historii i tradycji, najważniejszych wydarzeniach z Litwy, Polski oraz całego świata.  Już nie musisz szukać wiadomości w kilku aplikacjach czy portalach, możesz mieć wszystkie informacje w jednej aplikacji TVP Wilno.

Co oferuje Ci aplikacja TVP Wilno?
 * najważniejsze treści z portalu wilno.tvp.pl;
 * najnowsze informacje z całej Wileńszczyzny oraz życia Polaków na Litwie;
 * najciekawsze wydarzenia, niezwykłe spotkania, interesujące tematy zawarte w unikalnych materiałach wideo tworzonych przez polskich dziennikarzy na Litwie;
 * transmisje mszy świętych z różnych kościołów na Wileńszczyźnie;
 * fotogalerie z najpiękniejszych zakątków Wileńszczyzny;
 * bloki zagraniczne dla zainteresowanych wydarzeniami z całego świata;

Dziękujemy za pobranie i używanie aplikacji TVP Wilno. Aby zapewnić najlepszą jakość materiałów regularnie aktualizujemy aplikację.

